import React from "react";
import "./Navbar.css";

const Navbar = () => {
  return (
    <nav className="navbar">
      <div className="logo">BITE BUDDY</div>
      <div className="title">BTE BUDDY</div>
      <div className="profile-circle">S</div>
    </nav>
  );
};

export default Navbar;
